import React from 'react'
import "./CustomButton.scss"

function CustomBottom({ invert, children, ...otherProps }) {
    return (
        <button className={`${invert ? 'inverted' : ''} custom-button`} {...otherProps}>
            {children}
        </button>
    )
}

export default CustomBottom
